import { useState } from "react";



function Createtest(){
    const [input1, setInput1] = useState("");
    const [input2, setInput2] = useState("");
    const [input3, setInput3] = useState("");
    const [selectedOption, setSelectedOption] = useState("");
  
    const handleInputChange1 = (event) => {
      setInput1(event.target.value);
    };
  
    const handleInputChange2 = (event) => {
      setInput2(event.target.value);
    };
  
    const handleInputChange3 = (event) => {
      setInput3(event.target.value);
    };
  
    const handleDropdownChange = (event) => {
      setSelectedOption(event.target.value);
    };
  
    const handleSubmit = (event) => {
      event.preventDefault();
      console.log(input1);
      console.log(input2);
      console.log(input3);
      console.log(selectedOption);
    };
  
    return (
      <form onSubmit={handleSubmit}>
        <div>
          <label>
            Input 1:
            <input type="text" value={input1} onChange={handleInputChange1} />
          </label>
        </div>
        <div>
          <label>
            Input 2:
            <input type="text" value={input2} onChange={handleInputChange2} />
          </label>
        </div>
        <div>
          <label>
            Input 3:
            <input type="text" value={input3} onChange={handleInputChange3} />
          </label>
        </div>
        <div>
          <label>
            Çətinlik:
            <select value={selectedOption} onChange={handleDropdownChange}>
              <option value="">Select an option</option>
              <option value="Asan"> 1</option>
              <option value="Orta">Option 2</option>
              <option value="Çətin">Option 3</option>
            </select>
          </label>
        </div>
        <button type="submit">Submit</button>
      </form>
    );
  }


export default Createtest
